import React, { Component } from 'react';

class Impacto extends Component {
    render() {
        return (
            <section  className="container text-left" style={{paddingTop:"5%", paddingBottom:"5%"}}>
                <h2 style={{fontSize:"1.2em", color:"#009688"}}><strong>Aqui todos nós ganhamos. </strong></h2>
                <p className="lead">Aqui todos nós ganhamos. 

A cada descarte realizado através do e-Leve, uma porcentagem é direcionada para oficinas de remontagem. Logo, além da responsabilidade ambiental que promovemos, contribuímos para a formação de jovens e adultos na área de tecnologia. Vem com a gente!</p>
            </section>
        )
    }
}

export default Impacto;
